def mergeSort(input_array):

    if len(input_array) > 1:

        mid = len(input_array) // 2
        L = input_array[:mid]
        R = input_array[mid:]

        mergeSort(L)
        mergeSort(R)

        i = j = k = 0

        while i < len(L) and j < len(R):
            if L[i] < R[j]:
                input_array[k] = L[i]
                i += 1
            else:
                input_array[k] = R[j]
                j += 1
            k += 1

        while i < len(L):
            input_array[k] = L[i]
            i += 1
            k += 1

        while j < len(R):
            input_array[k] = R[j]
            j += 1
            k += 1


